import styled from "../assets/styles";
import { theme } from '../assets/styles/mainStyles';

export const Box = styled.div`
    position: absolute;
    width: 329px;
    height: 174px;
    background: #FFFFFF;
    border-radius: 10px;
`;

export const Title = styled.h1`
    font-weight: bolder;
    font-size: 18px;
    line-height: 22px;
    text-align: center;
    color: ${theme.colors.primary};
`;
